from typing import List


class Solution:
    def longestOnes(self, nums: List[int], k: int) -> int:
        n = len(nums)
        k_temp = k
        result = 0
        for i in range(n-k):
            counter = i
            total = 0
            k = k_temp
            while counter < n:
                if nums[counter] == 0:
                    if k == 0:
                        break
                    k -= 1
                counter += 1
                total += 1

            result = max(result, total)

            # print(f'n: {n}')
            # print(f'i: {i}')
            # print(f'total: {total}')
            # print(f'result: {result}')
            # print('-----------------------------')

        return result


